// Taken from Fresh crypto lib: https://github.com/rdubois-crypto/FreshCryptoLib/blob/master/solidity/external/ECCMath.sol

// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/Strings.sol";
import "./utils/ec-solidity.sol";
import "./utils/ECCMath.sol";

// TODO: use https://github.com/nucypher/numerology/tree/master for point multiplication (d'apres reno moins de gas)
// https://github.com/rdubois-crypto/FreshCryptoLib/blob/master/solidity/external/Numerology.sol
contract RingSigVerifier {
    // Curve parameters
    uint256 constant aa = 0;
    uint256 constant bb = 7;

    // Field size
    uint256 constant pp =
        0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFEFFFFFC2F;

    // Base point (generator) G
    uint256 constant Gx =
        0x79BE667EF9DCBBAC55A06295CE870B07029BFCDB2DCE28D959F2815B16F81798;
    uint256 constant Gy =
        0x483ADA7726A3C4655DA4FBFC0E1108A8FD17B448A68554199C47D08FFB10D4B8;

    // Order of G
    uint256 constant nn =
        0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFEBAAEDCE6AF48A03BBFD25E8CD0364141;

    constructor() {}

    function verifyRingSignature(
        string memory message, // keccack256 hash
        uint256[] memory ring, // ring of public keys [pkX1, pkY1, pkX2, pkY2, ..., pkXn, pkYn]
        uint256[] memory responses,
        uint256 c
    ) public pure returns (bool) {
        // check if ring.length is even
        require(
            ring.length > 1 && ring.length % 2 == 0,
            "Ring length must be even and greater than 1"
        );

        // check if responses.length = ring.length / 2
        require(
            responses.length == ring.length / 2,
            "Responses length must be equal to ring length / 2"
        );

        // compute strRing
        string memory strRing = formatRing(ring);

        // compute c1'
        uint256 lastComputedCp = computeC(
            strRing,
            message,
            responses[0],
            c,
            [ring[0], ring[1]]
        );

        // compute c2' to c(n-1)' (n = ring.lenth / 2)
        for (uint256 i = 2; i < ring.length - 2; i += 2) {
            lastComputedCp = computeC(
                strRing,
                message,
                responses[i / 2],
                lastComputedCp,
                [ring[i], ring[i + 1]]
            );
        }

        return // same as for i =  -> ring.length and then, return c == lastComputedCp
            c ==
            computeC(
                strRing,
                message,
                responses[responses.length - 1],
                lastComputedCp,
                [ring[ring.length - 2], ring[ring.length - 1]]
            );
    }

    function computeC(
        string memory strRing,
        string memory message,
        uint256 r,
        uint256 previousC,
        uint256[2] memory previousPubKey
    ) internal pure returns (uint256) {
        require(
            EllipticCurve.isOnCurve(
                previousPubKey[0],
                previousPubKey[1],
                aa,
                bb,
                pp
            ),
            "previousPubKey is not on curve"
        );
        // compute rG + previousPubKey * c
        // r * G
        (uint256 rGx, uint256 rGy) = EllipticCurve.ecMul(r, Gx, Gy, aa, pp);

        // previousC * previousPubKey
        (uint256 previousCpubKeyX, uint256 previousCpubKeyY) = EllipticCurve
            .ecMul(previousC, previousPubKey[0], previousPubKey[1], aa, pp);

        // r * G + previousC * previousPubKey
        (uint256 x, uint256 y) = EllipticCurve.ecAdd(
            rGx,
            rGy,
            previousCpubKeyX,
            previousCpubKeyY,
            aa,
            pp
        );

        // convert point to affine

        // ring + message + (rG + previousPubKey * c)
        bytes memory data = abi.encodePacked(
            string.concat(
                strRing,
                message,
                Strings.toString(x), // uint256(9955515929758664635576836987053099024683838556575823563212017955371396157685)),
                Strings.toString(y) // uint256(83823511917583193450688191130823431783071730688584821994994785850390237919571))
            )
        );

        return modulo(uint256(keccak256(data)), nn); // ok
        // return x;
    }

    function modulo(
        uint256 value,
        uint256 mod
    ) internal pure returns (uint256) {
        uint256 result = value % mod;
        if (result < 0) {
            result += mod;
        }
        return result;
    }

    function formatRing(
        uint256[] memory ring
    ) internal pure returns (string memory) {
        string memory strRing = "";
        for (uint256 i = 0; i < ring.length; i++) {
            strRing = string.concat(
                strRing,
                Strings.toString(ring[i])
            );
        }        
        return strRing;
    }
}

contracts/sbt.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {FunctionsClient} from "@chainlink/contracts/src/v0.8/functions/dev/v1_0_0/FunctionsClient.sol";
import {FunctionsRequest} from "@chainlink/contracts/src/v0.8/functions/dev/v1_0_0/libraries/FunctionsRequest.sol";
import "./ringSigVerifier.sol";

contract AliceRingToken is ERC721, ERC721URIStorage, Ownable,FunctionsClient {
    uint256 private _nextTokenId;
     using FunctionsRequest for FunctionsRequest.Request;
    /*uint256 equalTrue=; 
    uint256 equalFalse=;*/
    bytes32 public s_lastRequestId;
    bytes public s_lastResponse;
    bytes public s_lastError;

    uint32 gaslimit = 500000;
    bytes32 donId =0x66756e2d657468657265756d2d7365706f6c69612d3100000000000000000000;

    event Response(bytes32 indexed requestId, bytes response, bytes err);

    enum Status {
        UNKNOWN, // the proof has not been verified on-chain, no proof has been minted
        MINTED // the proof has already been minted
    }

    error AlreadyMinted(string proofId);
    error InvalidSignature();
    error InvalidTokenAmounts();
    error OnlyOwnerCanBurn(uint256 tokenId);
    error UnexpectedRequestID(bytes32 requestId);

    RingSigVerifier public verifier; // Instance of the ring signature verifier contract
    mapping(string => Status) public mintStatus; // signatureHash => Status (computed off-chain)

    constructor(
        address _verifier,
        address router 
    ) ERC721("AliceRingToken", "ART") Ownable(msg.sender) FunctionsClient(router)  {
        verifier = RingSigVerifier(_verifier);
    }

    // The following functions are overrides required by Solidity.
    function tokenURI(
        uint256 tokenId
    ) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721, ERC721URIStorage) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    /**
     * @notice safeTransferFrom is disabled because the nft is a sbt
     */
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public pure override(ERC721, IERC721) {
        revert("SBT: SafeTransfer not allowed");
    }

    /**
     * @notice transferFrom is disabled because the nft is a sbt
     */
    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public pure override(ERC721, IERC721) {
        revert("SBT: Transfer not allowed");
    }

    /**
     * @notice approve is disabled because the nft is a sbt and cannot be transferred
     */
    function approve(
        address to,
        uint256 tokenId
    ) public pure override(ERC721, IERC721) {
        revert("SBT: Approve not allowed");
    }

    /**
     * @notice getApproved is disabled because the nft is a sbt and cannot be transferred
     */
    function getApproved(
        uint256 tokenId
    ) public pure override(ERC721, IERC721) returns (address operator) {
        revert("SBT: getApproved not allowed");
    }

    /**
     * @notice setApprovalForAll is disabled because the nft is a sbt and cannot be transferred
     */
    function setApprovalForAll(
        address operator,
        bool _approved
    ) public pure override(ERC721, IERC721) {
        revert("SBT: setApprovalForAll not allowed");
    }

    /**
     * @notice isApprovedForAll is disabled because the nft is a sbt and cannot be transferred -> the output will always be false
     */
    function isApprovedForAll(
        address owner,
        address operator
    ) public pure override(ERC721, IERC721) returns (bool) {
        return false;
    }


    /** 
     * @notice Mint an SBT
     *
     * The sbt is minted to msg.sender
     * If the verification of the signature is okay see (https://github.com/Cypher-Laboratory/EVM-Verifier/issues/3) and :
     * - If mintStatus[proofId] == UNKNOWN, the proof is minted and the status is set to MINTED
     * - If mintStatus[proofId] == MINTED, the proof has already been minted. Tx will revert
     *
     * @param token - the erc20 address of the token we are proving the ownership of
     * @param minBalance - the balance threshold
     * @param uri - the IPFS uri
     * @param proofId - the hash of all the responses used in the proof
     * @param message - the hash of the message signed by the ring
     * @param ring - the ring of public keys
     * @param responses - the reponses of the ring
     * @param c - the signature c value
     */
    function mint( // TODO: comment on verifie que le message est bien valide -> le former dans le contrat
        address token,
        uint256 minBalance,
        string memory uri,
        string memory proofId,
        // signature data:
        string memory message, // should be keccack256 hash of message
        uint256[] memory ring, // ring of public keys [pkX1, pkY1, pkX2, pkY2, ..., pkXn, pkYn]
        uint256[] memory responses,
        uint256 c
    ) public payable returns (bool){
        if (mintStatus[proofId] == Status.MINTED) {
            revert AlreadyMinted(proofId);
        }

        if (!verifier.verifyRingSignature(message, ring, responses, c)) {
            revert InvalidSignature();
        }
        // if (!verifyTokenAmounts(token, minBalance, signature)) { // TODO: use chainlink api callto verify btc amounts
        //     revert InvalidTokenAmounts();
        // }
        mintStatus[proofId] = Status.MINTED;
        _safeMint(msg.sender, _nextTokenId);
        _setTokenURI(_nextTokenId, uri);
        _nextTokenId++;

        return true;
    }

    /**
     * @notice delete all the caracteristics of tokenId (burn)
     *
     * Only the owner of an sbt can burn it
     *
     * @param tokenId is the id of the sbt to burn
     */
    function burn(uint256 tokenId) external {
        if (ownerOf(tokenId) != msg.sender) {
            revert OnlyOwnerCanBurn(tokenId);
        }
        _burn(tokenId);
    }


    function sendRequest(
    string calldata source,
    FunctionsRequest.Location secretsLocation,
    bytes calldata encryptedSecretsReference,
    string[] calldata args,
    bytes[] calldata bytesArgs,
    uint64 subscriptionId
  ) external returns (bytes32){
    FunctionsRequest.Request memory req;
    req.initializeRequest(FunctionsRequest.Location.Inline, FunctionsRequest.CodeLanguage.JavaScript, source);
    req.secretsLocation = secretsLocation;
    req.encryptedSecretsReference = encryptedSecretsReference;
    if (args.length > 0) {
      req.setArgs(args);
    }
    if (bytesArgs.length > 0) {
      req.setBytesArgs(bytesArgs);
    }
    s_lastRequestId = _sendRequest(req.encodeCBOR(), subscriptionId, gaslimit, donId);
    return s_lastRequestId;
  }

    /**
     * @notice Store latest result/error
     * @param requestId The request ID, returned by sendRequest()
     * @param response Aggregated response from the user code
     * @param err Aggregated error from the user code or from the execution pipeline
     * Either response or error parameter will be set, but never both
     */
    function fulfillRequest(
        bytes32 requestId,
        bytes memory response,
        bytes memory err
    ) internal override {
        if (s_lastRequestId != requestId) {
            revert UnexpectedRequestID(requestId);
        }
        s_lastResponse = response;
        s_lastError = err;
        emit Response(requestId, s_lastResponse, s_lastError);
    }

    // Override the _burn function from ERC721
    function _burn(uint256 tokenId) internal override(ERC721) {
        super._burn(tokenId);
    }
}

